description:
These are both of the Capitol Albums box sets (volumes one and two) that were released in 2006 and 2008. Each album has been separated into mono and stereo mixes. because of this there are two copies of each album in this torrent, one mono, and one stereo. I hope you all enjoy these as much as I have.


